import './App.css';
import Navbar from './components/Navbar';
import {
  BrowserRouter as Router,
  Switch,
  Route
} from 'react-router-dom';
import './App.css';
import Home from './components/pages/Home'
import Products from './components/pages/products';
import Services from './components/pages/services';
import SignUP from './components/pages/SignUp';

function App() {
  return ( <
    >
    <
    Router >
    <
    Navbar / >
    <
    Switch >
    <
    Route path = "/"
    exact component = {
      Home
    } > < /Route> <
    Route path = "/"
    exact component = {
      Products
    } > < /Route> <
    Route path = "/"
    exact component = {
      Services
    } > < /Route> <
    Route path = "/"
    exact component = {
      SignUP
    } > < /Route> <
    /Switch> <
    /Router>

    <
    />
  );
}

export default App;
